new_model.eval()


def transform_image(image_bytes):
    my_transforms = transforms.Compose([transforms.Resize(255),
                                        transforms.CenterCrop(224),
                                        transforms.ToTensor(),
                                        transforms.Normalize(
                                            [0.485, 0.456, 0.406],
                                            [0.229, 0.224, 0.225])])
    image = Image.open(io.BytesIO(image_bytes))
    return my_transforms(image).unsqueeze(0)


def get_prediction(image_bytes):
    tensor = transform_image(image_bytes=image_bytes)
    outputs = model.forward(tensor)
    _, y_hat = outputs.max(1)
    predicted_idx = str(y_hat.item())
    return imagenet_class_index[predicted_idx]


def get_embedding(image_bytes):
    tensor = transform_image(image_bytes=image_bytes)
    outputs = new_model.forward(tensor)
    embedding = list(np.transpose(outputs.detach().numpy()[0])[0][0].astype(float))
#     print(embedding)
    return embedding


@app.route('/predict', methods=['POST'])
def predict():
    if request.method == 'POST':
        file = request.files['file']
        img_bytes = file.read()
        class_id, class_name = get_prediction(image_bytes=img_bytes)
        image_embedding = get_embedding(image_bytes=img_bytes)
        return jsonify({'class_id': class_id, 'class_name': class_name, 'image_embedding': image_embedding})


if __name__ == '__main__':
    app.run()
